import { InjectionToken } from '@angular/core';
import { Observable } from 'rxjs';

export const LOAD_USER_DETAILS_COMMAND_PORT =
  new InjectionToken<LoadUserDetailsCommandPort>(
    'LOAD_USER_DETAILS_COMMAND_PORT'
  );

export interface LoadUserDetailsCommandPort {
  loadUserDetails(id: number): Observable<void>;
}
